Body of Proof is an American medical drama television series created by Chris Murphey and produced by ABC Studios. Starring Dana Delany as medical examiner Dr. Megan Hunt, the series is currently airing on ABC.


Plot:
----------
The series stars Dana Delany as Dr. Megan Hunt, a medical examiner. The show focuses on Hunt's efforts to balance the demands of her professional life, dealing with solving cases and analyzing bodies, with her personal life, trying to reconnect with her estranged daughter. Hunt was a top-flight neurosurgeon, until she had a life-changing automobile accident and then accidentally killed a patient on the operating table. This resulted in her resignation, and retirement from the profession altogether.


